// Access the array that contains all files
// Adjust the path if necessary (e.g., $json.content or $json.files)
const files = $json.files || $json.content || [];

// If it's a dictionary of answers, flatten all URLs
let allUrls = [];
if (!Array.isArray(files)) {
  // if it‚Äôs a Jotform structure like answers -> each -> answer:[urls]
  const answers = files.answers || files.data?.answers || {};
  for (const key of Object.keys(answers)) {
    const a = answers[key]?.answer;
    if (Array.isArray(a)) allUrls.push(...a);
  }
} else {
  allUrls = files;
}

// Take the last file
const lastFile = allUrls[allUrls.length - 1] || null;

// Return it as a single field
return [{ json: { lastFile } }];

